import React from 'react';
import './Contetn2.css'; // Подключаем стили модуля

// Подключаем иконки, путь измените на актуальный
import icon1 from '../img/sss.png';
import icon2 from '../img/icon2.png';
import icon3 from '../img/icon3.png';
import icon4 from '../img/icon4.png';
import icon5 from '../img/icon5.png';
import icon6 from '../img/icon6.png';
import icon7 from '../img/icon7.png';
import icon8 from '../img/icon8.png';
import icon9 from '../img/icon9.png';
import icon10 from '../img/icon10.png';
import icon11 from '../img/icon11.png';
import icon12 from '../img/icon12.png';

const Contetn2 = () => {
  // Данные для прямоугольников
  const items = [
    { id: 1, name: 'Название 1', quantity: 'Количество 1', icon: icon1 },
    { id: 2, name: 'Название 2', quantity: 'Количество 2', icon: icon2 },
    { id: 3, name: 'Название 3', quantity: 'Количество 3', icon: icon3 },
    { id: 4, name: 'Название 4', quantity: 'Количество 4', icon: icon4 },
    { id: 5, name: 'Название 5', quantity: 'Количество 5', icon: icon5 },
    { id: 6, name: 'Название 6', quantity: 'Количество 6', icon: icon6 },
    { id: 7, name: 'Название 7', quantity: 'Количество 7', icon: icon7 },
    { id: 8, name: 'Название 8', quantity: 'Количество 8', icon: icon8 },
    { id: 9, name: 'Название 9', quantity: 'Количество 9', icon: icon9 },
    { id: 10, name: 'Название 10', quantity: 'Количество 10', icon: icon10 },
    { id: 11, name: 'Название 11', quantity: 'Количество 11', icon: icon11 },
    { id: 12, name: 'Название 12', quantity: 'Количество 12', icon: icon12 }
  ];

  return (
    <div className="grid-container">
      {items.map(item => (
        <div key={item.id} className="grid-item">
          <img src={item.icon} alt="Иконка" className="item-icon" />
          <div className="item-text">
            <div className="item-name">{item.name}</div>
            <div className="item-quantity">{item.quantity}</div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Contetn2;
